measurements.description:
One full flower on one sturdy 19.0-cm inflorescence;
	dorsal sepal white, veined green-brown, overlaid green basal one-third, transitioning to deep rose marginal two-thirds; 
	synsepal green, burgundy stripes, edge rose; 
	petals green basally transitioning to deep rose marginally, heavy dark mahogany warts basal two-thirds, upper margin hirsute; 
	pouch burgundy, veined darker burgundy; staminode pale green, darker green centrally; 
	substance medium; texture waxy.
